BEGIN;
8:00左右，手动停止备份作业。（有4条备份策略的加速备份仍然失效，使用普通备份模式）\n10:50左右，有用户再次反馈出现\\\\sgmw\\dep访问慢的现象，但资源监视器各项指标正常。从服务器本身访问\\\\sgmw\\dep同样很慢，但直接从磁盘拷贝文件正常。此时，TCAE存储打开文件数约24万，但仍旧无法确认其关联性。\n11:00左右，重启服务器后，文件访问恢复。\n12:20左右，逯晓明根据故障时抓包分析，发现在故障期间，服务器的SMB协议包都没有得到响应。\n\n2020.4.12 （周日）下午，用户再次报故障，文件夹无法访问。\n4.10 18:00开启备份，4.11 20:00左右，通过堡垒机访问办公PC，文件夹打不开。\n4.12 15:30，日志抓包，停止备份，系统重启后，服务恢复。\n\n2020.4.125（周三）上午11:50左右，用户再次报故障，文件夹无法访问。\n期间无任何备份作业，Tcae存储文件打开量为23万。\n抓包，重启服务器之后，服务恢复。', '1、停止执行HQFS01有异常的4条每日增量备份策略，定期检查备份状态。开Case，查找备份加速失败原因。\n2、开Case，建立监控方案，故障复现时查找文件夹SMB服务失效原因。\n3、监控TcAE存储连接数情况，查找规律与相关性。\n\n分散文件存储，减少单个磁盘的存储量，降低单个磁盘的压力。', '公司,后台,运维管理');
COMMIT;

