INSERT INTO `knlge_lesson_learn` VALUES (1, NULL, 0, NULL, NULL, 'IC间打扫清理，灰尘引发烟感报警', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '重庆站点', '直接原因:空气中灰尘过多触发烟感报警器\n间接原因:清理作业开展前，对作业点安全辨识不充分\n根本原因:\n1、为什么烟雾报警会被触发?\n空气中有很多的灰尘，被烟感报警器捕捉到。\n2、为什么空气中有很多的灰尘?\n员工清理网络交换机机柜里的积灰，灰尘扬起到空气中。\n3、为什么员工要清理网络交换机机柜里的积灰?\n积灰过多可能会引起现场网络设备(交换机)内部短路、高温等现象，是安全稳定运行的隐 患之一，会直接影响办公网络使用的稳定性。', '事件经过:\n16:05 员工到达行政楼一楼网络机房准备机柜的灰尘清理工作\n16:08 启动设备清理灰尘，灰尘扬起到空气中\n16:10 烟感报警被触发，员工停止清理工作，办公楼人员听到报警后开始疏散 16:16 安全科消防专员调查情况后关闭报警\n16:17 消防车到达现场\n16:19 警报解除，疏散人员解散，人员返回工作岗位', 'IT机柜清理的频次:一年一次\n防范措施:清理工作前充分进行相应的风险识别，并且与环境与健康安全科进行充分沟通， 避免引起不必要误报。', '工厂,现场,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (2, NULL, 0, 'SYS0420', '售后手册编辑系统', '用户误输入特殊字符等乱码，系统显示乱码', 999, b'1', NULL, 'admin', NULL, '2020-11-17 13:53:33', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '研发区域', '用户输入框没有对用户的输入进行合法性校验', '用户误输入乱码，系统显示乱码', '1、在前端开发逻辑中中，需要增加对用户的输入框里边的输入值进行合法性校验。\n2、以后需要在RFP等标准要求文档中，增加此项要求。', 'IT缺陷,前台,项目管理');
INSERT INTO `knlge_lesson_learn` VALUES (3, NULL, 0, NULL, '供应商用户管理系统', 'ASP.NET中Redis 每小时6000次访问请求', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '采购区域', 'C#利用ServiceStack.Redis来操作Redis，它是Redis官方推荐的C#客户端，性能非常优越，使用也很方便，但是版本升级到3.9.7之后，有如下的问题: \n每小时只能访问Redis 6000次', '用户登录验证的时候，会验证不通过，或取到错误的角色权限', '普通版每小时只能访问Redis 6000次，要取消这个限制就要付费或者您也可以往回使用V3.9.6以下版本，以后项目中使用此软件，需要对版本进行确认。', 'IT缺陷,后台,项目管理');
INSERT INTO `knlge_lesson_learn` VALUES (6, NULL, 0, 'SYS0209', 'SAP', '进项税调整-SAP系统采购业务需变更的程序', 999, b'1', NULL, 'admin', NULL, '2020-11-17 13:58:15', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SYS20190173', '027-20190917-229', '028-20190923-268', NULL, '商务区域', '以往的进项税调整时，没有进行总结，并形成知识沉淀', '国家对进项税进行调整时，SAP系统中对应的程序也需要做适应性调整。\n在以往调整过程中，存在程序识别有遗漏的情况，导致部分程序数据错误，影响业务运行。', '基于本次进项税相关的程序变更；对2019年上半年进项税变更时，涉及的所有采购相关的、需要变更的SAP程序进行识别，并识别出更改方式。\n资料路径：\\\\Cnwulhqfs01\\信息系统与服务部\\9.采购及供应链业务支持科\\5.业务管理\\1.采购\\事件&amp;需求\\2019\\2019-9-6：税率表更导致报表调整\n\n事物代码	        程序名	                描述	                                                                       变更方式\nZFIWFD017	ZRFI_WL_FD_017	下载付款建议(A格式)	                                       修改程序\nZFIWFD021	ZRFI_WL_FD_021	现汇付款凭证创建	                                               修改程序\nZFIWFD018	ZRFI_WL_FD_018	付款计划建议上载（格式B）	                               修改程序\nZFIWFD019	ZRFI_WL_FD_019	付款计划审核                   	                               修改程序\nZFIWFD020	ZRFI_WL_FD_020	付款计划批准	                                                       修改程序\nZFIWFD022	ZRFI_WL_FD_022	票据付款凭证创建	                                               修改程序\nZFIWFD023	ZRFI_WL_FD_023	生产、配件采购付款计划--票据凭证查询报表	       修改程序\nZFIWFD024	ZRFI_WL_FD_024	自动付款—月度付款计划汇总表	                       修改程序\nZFIWFD025	ZRFI_WL_FD_025	自动付款—年度计划内付款汇总表	                       修改程序\nZFIPFD002	      ZRFI_WL_FD_017_4	自动付款-配置(Display All)	               修改程序\nZFIWFD017_4      ZRI_FI_PC_FD_002	        折扣通知单	                                       修改程序\nZFIWFD039	ZRFI_WL_FD_059	票据直连背书管理平台	                                       修改程序\nZFIWFD077	ZRFI_WL_FD_045	供应商结算校验平台	                                       修改程序\n无            	ZRFI_WL_FD_044	PO结算清单	                                                       修改程序\n无	                ZRFI_WL_FD_042	供应商配件补差结算清单	                               修改程序\n无            	ZRFI_WL_FD_043	折扣清单	                                                               修改程序\n无            	ZRFI_WL_FD_039	供应商寄售物料结算清单	                               修改程序\n无            	ZRFI_WL_FD_040	供应商配件结算清单	                                       修改程序\n无            	ZRFI_WL_FD_041	供应商寄售补差结算清单	                               修改程序\nZWMM19	ZWPDMM_MAT_CONSUMPTION_LIST_C	供应商寄售物料未结清单--特殊协议日期的物料结算	修改程序\n无	                ZRFC_FI_WL_FD_013	税率获取	                                                       修改程序\nZMMWPCL010	AQC8MMTEAM======ZMM10-NEW=====	采购订单查询	       修改query\nZMMWPCL012	ZRMM_QD_PCL_001	采购审批平台	                                       修改程序', '公司');
INSERT INTO `knlge_lesson_learn` VALUES (7, NULL, 0, NULL, '总部办公网络', '2019-8-1 企业办公网络中断1级事件', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '直接原因：新上架服务器接线接入企业级服务器交换机端口E1/27\n技术原因：交换机端口E1/27已配置为交换机与办公防火墙的聚合接口，一直未接线使用；交换机接线后，因E1/27,E/28是聚合接口，交换机与防火墙的流量会进入接服务的端口E1/27，导致路由异常，并直接导致办公网络异常。\n管理原因：1.不用的端口配置未清理。\n                 2.接线前未检查端口配置。\n                 3.无线AP未日检。', '16:35 用户反馈办公网络访问异常；\n16:50 梁永光、郑祥飞临时进行办公防火墙主备切换，网络未恢复；\n17:00 建立0801网络重大事件处理小组；\n17:08 各区域确认网络状态：总部有线、无线，研发无线访问异常，其他区域网络正常，影响范围确认为企业办公网络；\n17:30 郑祥飞关闭一台企业级办公防火墙，网络未恢复；\n17:40 旁路一台防火墙，网络未恢复；\n17:55 郑祥飞、种辉对另一台防火墙旁路、梁永光同时关闭了企业办公后台E1/27口，网络恢复；\n19:37 郑祥飞与厂商分析后，找到故障原因\n19:55 把防火墙接回网络，网络正常；', '1、关端口清配置：服务器交换机不使用的端口应关闭，同时清理遗留配置\n2、网络信息统一：统一网络设备信息管理，便于及时提取信息\n3、接口配置检查：服务器接线时，应先提前确认交换机接口配置。', '公司,前台');
INSERT INTO `knlge_lesson_learn` VALUES (8, NULL, 0, NULL, '总部办公网络', '2019-8-21 宏光大楼销售、采购办公网络中断事件', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '直接原因：宏光大楼一楼东、西的网关交换机上联商务机房光缆被挖断。', '10:41  用户反馈宏光大楼一楼东办公网络不可用；\n10:50 梁永光、种辉登入上联交换机查看日志及查看接入层监控，初步判断光缆中断；\n10:54 种辉通知小网络改造服务商协调工程师到宏光楼查看光缆；\n11:00 与营销区域沟通事件，建立沟通群\n11:10 梁永光、种辉现场查看设备物理连接，交换机连接的光纤指示灯灭，确认上联到商务机房的光缆中断，导致宏光大楼一、二楼东面销售、一楼西面采购办公网络中断；\n11:20 根据现场光缆情况及与河西站点沟通，决定临时使用河西视频监控空余光纤，临时跳接，尽快恢复网络；种辉回库房拿跳接的尾纤去商务机房跳纤，梁永光宏光楼配合跳纤。\n11:50 小网络改造服务商，通过仪器检测，发现光缆断点为78米处；\n12:10 完成一楼西面光纤临时跳接，一楼西采购办公区域网络恢复；\n12:18 完成一楼东面光纤临时跳接，一楼东面、二楼东面销售区域办公网络恢复；\n13:00 确认后续工作项，系统集成跟踪后续工作，目前具体断点物理位置还未找到，光缆中断原因待继续跟踪。\n2019-8-22 17:38 确认光纤断点，两个断点，一处弯折', '1、宏光大楼设计有冗余线路，但2016年中断，一直未做修复，无人跟进负责；\n2、总部关键办公区域线路是否有冗余的情况不清；\n3、进入花圃的光缆，容易被锄头挖断；', '现场');
INSERT INTO `knlge_lesson_learn` VALUES (9, NULL, 0, NULL, '总部应用负载均衡', '2019-9-3 F5主备切换服务中断事件', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '直接原因：F5主备切换导致部分对外发布系统异常\n根本原因：电信网关检测机制，导致F5主备切换时，不能把业务切换过去', '2019-9-1 8:50  郑祥飞远程执行河西发动机拉动紧急变更发布，修改F5相关配置，在保存配置时VPN中断。\n2019-9-1 9:20郑祥飞重新连接VPN后发现F5自动切换了主备，而且调整的配置也没有了，重新配置河西拉动服务器后，发现F5不能同步配置，原因是主备设备时间差异超过了10分钟；\n2019-9-1 10:50 ，郑祥飞联系供应商远程支持，供应商检查日志，没有找出主备切换原因，设备除了时间相差超过10分钟之外没有发现其他异常；修改NTP配置，由于防火墙阻挡，NTP服务异常，手动修改F5主备设备时间，同步配置正常，12：50林挺锋反馈拉动系统切换后服务正常。\n2019-9-2 15:30郑弦反馈公司一台邮件网关和一台驻外人员使用的Pop3邮件服务器服务异常，由于最近调整过WAF和IPS相关安全策略，郑祥飞检查IPS、WAF相关设备未发现异常\n2019-9-2 16:04郑弦确认邮件网关最后服务正常的时间是2019-9-1 9:05，确定故障是F5切换主备后出现的，郑祥飞检查F5的配置，未发现异常；\n2019-9-2 18:15郑弦、郑祥飞在机房硬重启邮件网关服务器，服务恢复正常；\n2019-9-2  19:30Pop3邮件服务器是虚拟机，没有办法进行硬重启，进行了关机，在虚拟机平台重启，服务仍然不正常；\n2019-9-2  20:15郑祥飞切换F5主备，PoP3邮件服务恢复正常；\n2019-9-2 22:53  郑祥飞接到朱炬明反馈，销售公司自建的呼叫中心系统在20:15左右服务中断。\n2019-9-2 23:50 郑祥飞进入机房，硬重启语音网关设备，服务没有恢复，协助呼叫中心供应商切换到测试的呼叫中心系统；\n2019-9-3 8:57 ，联系供应商远程支持，开始排查故障；\n2019-9-3 9:10 与值班团队、规划治理、营销区域沟通事件，建立沟通群；\n2019-9-3 9:30 逯晓明收集到受影响的服务：合格证上传、菱菱通、VPN、联想云盘、EAI B2B、机房监控短信告警；\n2019-9-3 14:10 供应商远程检查F5，一直没有发现问题，14:13将IPS旁路，问题仍没有得到解决；\n2019-9-3 14:40 决定切换F5主备，将IPS恢复，切换前重启F5； \n2019-9-3 14:48 重启F5备机，15:00切换F5主备，切换后合格证上传、菱菱通、VPN、联想云盘、EAI B2B、机房监控短信告警恢复正常，但邮件网关和Pop3邮件服务再次失效；\n2019-9-3 15:43 李文杰硬重启邮件网关后，服务恢复正常；\n2019-9-3 15:51 李文杰在客户端访问Pop3邮件服务的联通IP地址，之后Pop3邮件电信服务自行恢复，原因未明，至此，全部服务恢复正常；\n2019-9-3 16:30 重启F5备机 。', '1、关键网络冗余设备主备切换引起网络问题；\n2、运营商的主备检测机制，需要关注', '公司,前台');
INSERT INTO `knlge_lesson_learn` VALUES (10, NULL, 0, 'SYS0237', '总部专线', '2019运营商专线失效分析报告', 999, b'1', NULL, 'admin', NULL, '2020-11-17 13:58:30', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', NULL, '外部施工挖断光缆是专线失效主要原因（53%）；\n12次专线失效事件中，有11次有备用线路，服务未完全中断，但切换期间会影响线路质量；\n路由相同的专线有服务完全失效风险；\n极端天气时线路中断风险较高', '二、需要改进的地方：\n\n1、柳州配件仓库专线在柳太路之后路由重叠；\n2、联通用户出口互联网专线两个月之内出现了两次相同的故障；\n3、印尼专线失效修复时间较长；', '公司,前台');
INSERT INTO `knlge_lesson_learn` VALUES (11, NULL, 0, NULL, '总部上网代理', '益菱用户通过代理无法上网', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2019101894', NULL, NULL, NULL, NULL, '系统集成', '上网代理系统Web界面配置了柳州电信的DNS服务器：202.103.224.68和202.103.225.68，但OS底层没有生效，OS中生效的DNS配置还是出厂时的广东电信的DNS202.96.128.68和202.96.134.33，这两台DNS服务器工作不正常', '益菱用户和部分配置代理的用户不能通过浏览器访问网站，提示“DNS解析失败”，但QQ、微信等小程序能正常使用。', NULL, '前台');
INSERT INTO `knlge_lesson_learn` VALUES (13, NULL, 0, NULL, '总部应用负载均衡', 'F5主备切换导致部分DMZ服务器访问互联网的服务中断', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '柳州电信设备的ARP更新机制不接收F5主备切换时主动发出的免费ARP请求，后面请柳州电信基于公司互联网IP段接受免费ARP请求后F5主备切换服务正常', 'F5主备切换后，邮件网关外发邮件、EAI B2B外传数据等从DMZ访问互联网的服务会中断', '1、关键的主备设备定期需要进行主备切换服务验证\n2、邮件网关更换IP地址后，需要请运营商更新PTR记录（反向地址解析）', '后台');
INSERT INTO `knlge_lesson_learn` VALUES (14, NULL, 0, NULL, '出厂物流系统', '出厂物流接口服务异常', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SYS20190280', '027-20191017-268', NULL, NULL, '营销区域', '销售中台新增接口数据量增长导致接口节点处理能力达到瓶颈', '出厂物流-&amp;amp;gt;销售中台发车/入库/出库接口服务异常终止数据发送', '1、评估接口节点的处理能力，即将达到处理瓶颈时提前预警，申请资源预先进行新节点的部署\n2、在项目中进行压力测试的时候，上下游系统都要集成在一起进行压力测试。', 'IT缺陷,后台');
INSERT INTO `knlge_lesson_learn` VALUES (15, NULL, 0, NULL, '总部EAI', 'SAP整车基础数据下发数据量大优化', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SYS20190281', NULL, NULL, NULL, '数据集成', '数据量过大，导致下游MES处理不及时', '1、sap负责维护宝骏、重庆的整车基础数据，并下发到宝骏、重庆mes、出厂物流指导生产和整车入库，目前都是采用变更一次性下发\n2、由于车型品种越来越多，特别是新能源车，每个车型项目都有几万品种代码，每次上车型公告后，对车型的变更数据量越来越大，一次性下发照成了下游系统的数据交易堵塞，甚至失败，影响生产。已出现过一次事件导致宝骏mes无法收到新能源变更数据', '1、设计时mes采用webservice接口，这种接口方式处理速度比较满，以后都需要改成API json接口，最好用中间表方式\n\n2、业务接口数据预计要有前瞻性，当时预计品种代码最多几百种，数据量不大，但业务在不断发展，以前设计放大现有业务量的2倍设计，现在需要放大到10倍设计\n\n3、定期监控业务量的变化，及时调整接口处理机制或者下游系统的处理能力。', NULL);
INSERT INTO `knlge_lesson_learn` VALUES (16, NULL, 0, NULL, '出厂物流系统', 'EXMIS数据库同步异常造成的服务失效', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2019110331', NULL, NULL, NULL, NULL, '营销区域', 'SQL Server数据库事务复制替换账号无法简单替换恢复服务，需重新初始化数据和服务配置，过程中资源大量占用', '1、报表数据库数据同步失效\n2、数据订阅初始化期间，生产数据库响应慢', 'a、完善配置项交付：服务交付运营时提供配置项清单，列明系统后台配置时所用到的特权账号及所涉服务\nb、规范系统配置使用特权账号：仅本系统服务配置本地账号enduser，远程服务调用使用专用域账号，避免使用个人账号/命名无法辨识关联系统域账号\n2、经验点：SQL Server数据库事务复制替换账号无法简单替换恢复服务，需重新初始化数据和服务配置，过程中资源大量占用，除非已实际失效否则应在窗口期操作\n3、经验点：事件恢复操作步骤事先评估关联系统/系统影响。\n4、经验点：对公用账号的使用建立统一的账本，变更之前需要提交账本做影响识别。', NULL);
INSERT INTO `knlge_lesson_learn` VALUES (18, NULL, 0, NULL, '出厂物流系统', '整车多式联运项目上线', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '3e5ccb', NULL, NULL, 'HX-ISS-VSSM-2018-05', '营销区域', '操作问题，正式发布的程序版本与测试的程序版本不一致', '第一次项目上线，业务验证失败。 第二次重新调整程序包，上线成功。', '1、必须做好程序版本控制，涉及到重大程序版本变更的，必须细化被修改的文件版本\n2、需基于版本控制清单，再次核对发布程序包', '运维管理,开发管理,服务交付');
INSERT INTO `knlge_lesson_learn` VALUES (19, NULL, 0, NULL, '总部VPN', '新增VDI环境变更（3个虚拟服务器）', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '757991', NULL, NULL, NULL, '规划治理', '服务器上的终端远程访问许可未激活，需要购买微软许可', 'VDI虚拟服务器部署不成功', '需要识别各种环境的许可问题', '后台');
INSERT INTO `knlge_lesson_learn` VALUES (20, NULL, 0, NULL, '数据展示平台', '对基础环境端口识别不全，导致数据中台-质量追溯查询利用发布失败', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '99a4ae', NULL, NULL, NULL, '数据集成', '帆软（10.1.81.42）访问数据中台服务器（10.2.30.17～23）端口（21050、10000）未在防火墙中开通，数据连接失败', '数据展示平台所需数据连接无法创建，目标数据服务器无法连接', '测试环境与正式环境对比，在防火墙设置的差异上较大。在正式环境部署前，应当充分识别防火墙规则，以及可能存在的风险，并提前验证。', '后台,项目管理,架构管理,变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (21, NULL, 0, NULL, '菱菱通', '修复问题后导致首次登陆系统无法修改密码', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '49c6eb-68aed3-6dfd8d-70af4b', NULL, NULL, NULL, NULL, '规划治理', '功能间有关联，未识别到之间的代码关联。', '修复5个问题，导致首次登陆系统无法修改密码', '功能间有关联，未识别到之间的代码关联。尽量变更前识别关联，测试过程中测试充分。询问有经验的供应商支持。', '服务交付');
INSERT INTO `knlge_lesson_learn` VALUES (23, NULL, 0, NULL, '营销节点', '营销节点虚拟化平台故障', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2019112603', NULL, NULL, NULL, NULL, '营销区域', '---网络端口故障： 营销节点物理服务器VSAN专用网络端口异常（但未完全失效），拖累了整个营销节点VSAN的IO性能，导致部分虚拟服务器间歇性卡顿，系统作业超时失效；\n---事件处置不当：首次尝试恢复故障过程未充分识别配置修改对虚拟化平台的影响，导致影响进一步扩大；', '营销节点物理服务器VSAN专用网络端口异常（但未完全失效），拖累了整个营销节点VSAN的IO性能，导致部分虚拟服务器间歇性卡顿，系统作业超时失效；尝试修复故障表象报警，导致整个平台失效', '网络端口故障--更换端口模块；\n\n未及时发现异常--建立统一的虚拟化平台月度检查机制，标准化检查内容；\n\n供应商人员能力参差不齐，给出的技术方案有严重问题--统一定义IT虚拟化平台的服务要求，包括服务等级、服务质量要求，在下一个运维周期执行；\n\n紧急事件处理过程中做了配置变更，但没有得到授权--凡是涉及配置变更的操作，必须上升值班团队协调紧急发布授权，以控制执行风险，否则视为违规操作；\n\nBP不具备节点运维能力，仅一人无法同时开展故障排查和紧急预案--营销与系统集成联合制定BP技能培养计划，明确日常职责分工；\n\n目前灾难恢复只考虑了单个系统，无针对整个虚拟化环境的快速恢复预案，一旦出现极端情况，后果无法承受--评估基础环境和迁移方式，确定各站点/节点的虚拟化平台灾备可行性；\n\n排查故障过程及确定原因草率--1、建立定位问题原因的标准处理动作；2、记录至系统画像，并对各区域系统集成BP、主管以及供应商都做到应知应会；\n\n灾难恢复预案混乱--明确灾难恢复预案中各角色的分工；\n\n对超融合等新技术的技术储备不够--将超融合等已经在用的新技术做深做透，并做好技术储备；', 'IT缺陷,后台,运维管理,变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (24, NULL, 0, NULL, '青岛生产网络&amp;办公网络', '青岛BDC网络故障影响自动分车', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '青岛站点', '机柜内单台交换机运行，交换机故障引起网络失效', '青岛总装N110机柜网络失效，造成BDC无法自动分车', '针对关键生产点位进行网络识别，失效网络有效冗余。接入层网络机柜需失效双机堆叠热备，一台交换机发生故障时可以迅速切换至备机。', '工厂,现场,前台');
INSERT INTO `knlge_lesson_learn` VALUES (25, NULL, 0, NULL, '宝骏备份服务', '宝骏备份占满专线带宽事件总结', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '宝骏站点', '宝骏到柳州总部电信专线带宽占用率将近100%，异地备份作业占用大量带宽', '总部经办会，发现宝骏视频会议设备丢包率9.8%以上，视频延迟影响会议使用', '1、修改宝骏异地备份策略，限制上行带宽。\n2、加强日常例行数据备份检查，包括异地和本地备份检查。\n3、避开周一经办会时间段，修改异地复制时间，设置为每天晚上8点到第二天早上7点，其他时间不允许异地复制。', '公司,IT缺陷,后台,服务交付');
INSERT INTO `knlge_lesson_learn` VALUES (29, NULL, 0, NULL, '出厂物流系统', '促销系统架构调整，但是未做DR，出现故障恢复时导致长时间服务失效。（补录）', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '营销区域', '系统架构重大变化之后，未做DR验证，导致系统DR时间未能及时预估。', '促销系统架构调整，数据库同步采用了数据变化即同步技术，此技术恢复数据同步的时候，花费了大量时间，导致系统卡死。', '系统架构重大变化之后，必须做DR验证，确认DR时间。', '后台,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (30, NULL, 0, NULL, '总部无线网络', '大量无线客户端无法连接', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '因为 8.5版本后，无线控制器不再支持 TKIP 的加密方式，而公司电脑在无线初始化配置时是使用 TKIP 的加密方式，改成 AES 之后就行了。', '自无线控制器版本从 8.0.121.0 升级到 8.5.151.0 之后，大量无线客户端无法连接到办公网络。', '需要让多个真实用户进厂验证', '变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (32, NULL, 0, NULL, '重庆生产网络&amp;办公网络', '重庆发动机工厂控制网络异常', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '重庆站点', '网络成环', '1、服务台接到发动机装配线电话，报告网络断\n2、检查确定QS-stat，Flexnet等应用均正常，机加工车间运行正常，装配LoopC正常（ LoopA内部零件，LoopB外部零件;LoopC缸盖分装）\n3、检查确定汇聚层、接入层设备均正常，\n4、检查接入层交换机，逐个端口检查，发现连接PLC控制柜的网络接口的吞吐异常，拔出后吞吐恢复，判断是下位控制网络的网络风暴造成，', '控制网络下位接入管理不规范：下位的控制网络结构不合理、定义不清晰；发动机维修工程师技能不足；', '工厂,现场,前台');
INSERT INTO `knlge_lesson_learn` VALUES (34, NULL, 0, NULL, '公司视频会议系统', '2019-11-18行政楼附二楼大会议厅视频会议设备的服务失效的说明', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2019111192', NULL, NULL, NULL, NULL, '商务区域', '由于不确定的原因令笔记本电脑的电源适配器内部器件炸裂，产生强烈脉冲电压，也导致笔记本电脑内部出现强烈脉冲电压（笔记本电脑也已损坏），强脉冲电压沿HDMI信号线灌入图像拼接器，使得被芯片击穿、最终导致板卡损坏。', '2019年11月18日下午1:05时，会议系统已正常运行并与各基地确认，秘书科笔记本电脑已连接HDMI并正常投影，此时秘书将笔记本电源适配器插头插入桌面插座，听到电源适配器响起元件炸裂声，投影幕布上的图像消失。\n经过重启设备进行检查，发现会议桌上的HDMI信号无法投影，青岛基地图像无法显示，推测为图像拼接器故障，关机后拆下拼接器的输入板，发现多个元件损坏，其中图像输入处理卡的芯片已经炸裂，由于会议桌视频与青岛视频输入在同一块输入板上，导致会议桌以及青岛视频无法显示。', '更换损坏的板卡并修复正常，同时进行会议桌面放置提示牌及整改信号传输通道措施：\n1、在桌面放置提示牌，要求先连接电脑电源，正常后才连接HDMI视频线；\n2、对HDMI视频信号进行隔离处理：\n     由于HDMI/DVI 等数字视频信号的设计规范并不支持热插拔，频繁的插拔容易导致故障，此外静电也容易导致接口芯片损坏，可以采用信号转换器进行隔离，将HDMI信号转换后，通过双绞线传输，信号到达设备间后在转换为HDMI/DVI信号，由于有转换器的隔离，降低拼接器接口卡被击穿的风险。', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (37, NULL, 0, NULL, '总部IP电话', 'IP电话路由配置更改', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2019120127', NULL, '027-20191204-333', '028-20191204-419', NULL, '规划治理', '电信运营商规定从IP电话传输的号码必须带有“用户”“国内”“国际”三种标准标识，而我们的系统一直使用思科默认的标识传输，导致电信运营商无法识别。直至电信运营商切割数字中继线并启用标准后，拨打外拨电话失效。', '由于电信运营商对数字中继线的切割及强制要求规范传输所拨打的号码的类型属性（本地、国内、国际），造成所有IP电话拨打外部号码都有可能无法拨通，目前已有柳州拨打外地固话号码出现故障。', '规范供应商行为，在进行相关变更时应提前通知变更内容和识别影响范围，及时进行验证。', '后台,服务交付');
INSERT INTO `knlge_lesson_learn` VALUES (38, NULL, 0, NULL, 'IT数据中台', '需求DS20190303提供经销商及厂内库存数信息接口', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'DS20190303', NULL, NULL, NULL, '数据集成', '技术中心新宝骏大数据平台缺乏相关数据', '销售公司提出需要对经销商主数据和厂内库存及社会库存数做数据服务，需要提供IT接口供调用', '整车库存作业数据的owner是销售公司，TDC提出的菱菱通需求单不能只在TDC内部签署，需要流转到销售公司进行签署。', '业务缺陷');
INSERT INTO `knlge_lesson_learn` VALUES (39, NULL, 0, NULL, '总部办公网络', '总部办公网络增加新的IP电话地址段拨打手机时听不到对方声音，但手机端能听到声音', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '系统集成', '总部办公网络使用的是OSPF路由协议，总部办公和Core连接使用的是eigrp路由协议，core和其他站点使用BGP路由协议，不同协议之间需要进行重分发', '总部办公网络增加新的IP电话地址段后IP电话能获取正常的IP地址，Ping文件服务器正常，拨打内部IP电话正常，但拨打外线、重庆、青岛IP电话时听不到对方声音，但对方能听到声音。', '新增网段测试时，不能只ping常见的服务器IP，还需要跨站点ping交换机或服务器IP', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (40, NULL, 0, NULL, 'SAP', '调整SAP程序ZR_PP_PC_TDC_004逻辑，增加过滤掉空行的逻辑条件。', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2020011206', NULL, '027-20200116-410', NULL, NULL, '商务区域', '经排查，是业务手工补冲8000工厂THO零件在超级BOM中维护的OD的文本描述中含有空行引起的，删除空行后恢复', 'TDC用户反馈SAP无法查看及导出LZW7002EVBHW车型的单一BOM及交叉BOM，', '已告知业务规范操作，同时优化SAP程序，起到防错作用。', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (41, NULL, 0, NULL, 'TcAE', 'TcAE', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '研发区域', '故障原因：\n   根据GM专家描述，这种情况在泛亚也存在，存在一些用户在做比较大进程的操作时，会锁定一些系统表，导致后续用户使用慢或者无法登陆，GM在这个问题处理上有一些专用的查询工具和处理方法', '事件描述：\n   2020.2.21 9:45左右，服务台报有10多个用户报无法访问TcAE系统，马上远程到公司电脑上登录，发现登录2次提示超时，偶尔登录了1次，发现操作也很慢；\n   10:00  联系研发区域网络负责人王晓海，得知网络没有相关的变更，现场网络也不存在异常；\n   10:10  通过VPN连接到tcae堡垒机，按照操作手册检查tcae和数据库集群状态，检查服务器和集群状态都正常； \n   10:20  与系统运维工程师建立故障处理瞩目会议，联系GM和西门子 TcAE专家，告知故障现象，并及时拨入；\n   10:30  GM和西门子专家检查系统状态后，初步判断可能是用户有大进程的用户操作，导致数据库表被锁定，造成其他用户需等待表解锁后才能使用。GM专家表示这种情况在泛亚也存在，有一些工具可以查询锁表的电脑编号，并强制解锁。\n   10:50  GM专家找到了这些工具在数据库上进行查询，但此时发现数据库已经没有锁，此时让用户验证，发现系统均能正常使用。由于进程锁定是过程性的信息，此时已无法锁定是哪台电脑做的操作。\n\n故障原因：\n   根据GM专家描述，这种情况在泛亚也存在，存在一些用户在做比较大进程的操作时，会锁定一些系统表，导致后续用户使用慢或者无法登陆，GM在这个问题处理上有一些专用的查询工具和处理方法。\n\n后续措施：\n1、由GM提供该故障的查询工具和处理方法，在下次数据库锁还没消失前，能锁定是哪个用户在进行操作，并能快速处理；\n2、经与西门子沟通，当前TcAE版本在处理这种场景下是存在一定的缺陷的，但在下个版本针对此问题已经进行优化。', '后续措施：\n1、由GM提供该故障的查询工具和处理方法，在下次数据库锁还没消失前，能锁定是哪个用户在进行操作，并能快速处理；\n2、经与西门子沟通，当前TcAE版本在处理这种场景下是存在一定的缺陷的，但在下个版本针对此问题已经进行优化。\n请用下面的脚本创建3个view，然后执行 select * from killholder\n\n会看到类似如下的sql，拷贝执行即可，然后再执行select * from killholder，继续拷贝执行，直至查询返回空。\n\nalter system kill session &#39;2412,14189&#39;\n\n \n\n==============================================================================\n\ncreate or replace view holdersession as\n\nselect SESS, REPLACE(SESS,&#39;Holder: &#39;,&#39;&#39;) SESSID from\n\n(\n\nSELECT inst_id,DECODE(request,0,&#39;Holder: &#39;,&#39;Waiter: &#39;)||sid sess, \n\n        id1, id2, lmode, request, type,block,ctime\n\nFROM GV$LOCK\n\nWHERE (id1, id2, type) IN\n\n       (SELECT id1, id2, type FROM GV$LOCK WHERE request&gt;0)\n\nORDER BY id1, request) where SESS like &#39;Holder%&#39;\n\n \n\n \n\ncreate or replace  view allsession as\n\nselect sess.sid, \n\n    sess.serial#, \n\n   sess.machine,\n\n    lo.oracle_username, \n\n    lo.os_user_name, \n\n    ao.object_name, \n\n    lo.locked_mode \n\n    from v$locked_object lo, \n\n    dba_objects ao, \n\n    v$session sess \n\nwhere ao.object_id = lo.object_id and lo.session_id = sess.sid\n\n \n\n \n\ncreate or replace view killholder as \n\nselect distinct KILLSQL,machine,os_user_name from\n\n(\n\nselect &#39;alter system kill session &#39;&#39;&#39;||SESSID||&#39;,&#39;||SERIAL#||&#39;&#39;&#39;;&#39; KILLSQL,machine,os_user_name\n\nfrom (\n\nselect holdersession.SESSID,allsession.SERIAL#,allsession.machine,allsession.os_user_name from holdersession left join allsession  on holdersession.sessid=allsession.SID\n\n)\n\n)', NULL);
INSERT INTO `knlge_lesson_learn` VALUES (42, NULL, 0, NULL, '总部用户互联网防火墙', 'Checkpoint管理平台对防火墙脱管', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2020031634', NULL, NULL, NULL, NULL, '系统集成', '由于证书和数据库不匹配导致', '1、登录smartcenter控制台之后，到所有防火墙的连接显示叉（X）,防火墙策略修改后不能下发\n2、部分控制台登录之后弹出错误提示框“Certificate revoked”', '通过ssh登陆到smartcenter后台重新生成证书后恢复', NULL);
INSERT INTO `knlge_lesson_learn` VALUES (43, NULL, 0, NULL, '总部虚拟化平台', '不可迁移的虚拟机', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', 'CNWULEXCEL02：许可绑定物理主机，不可迁移\nCNWULOADB01:集群共享存储，不可迁移\nCNWULOADB02:集群共享存储，不可迁移', '在进行总部虚拟化平台版本升级发布时，识别到以下虚拟机绑定虚拟化平台主机，无法进行迁移。CNWULEXCEL02/CNWULOADB01/CNWULOADB01', '必须进行虚拟机的关机，才能进行虚拟化平台的升级。\n对于菱菱通数据库（oracle数据库集群）需要与应用负责人确认停机关闭步骤', '变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (44, NULL, 0, NULL, '总部网站应用级防火墙', 'WAF架构调整发布总结', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', '直接原因：F5负载均衡设备上进行了解密，WAF架构调整后，对解密后的流量进行了分析并拦截了出厂物流系统的打印行为以及公司外发的邮件；同时架构调整后，WAF不仅对互联网访问DMZ以及对于内部访问DMZ的流量都会进行检测，部分内部IP地址不规范，被WAF作为国外IP进行拦截。\n根本原因：是发布后进行应用验证时，只是简单的验证了打开网页是否正常，是否能登录系统，但对于应用的关键业务功能验证不全，测试时未能及时发现问题。以及现在网络中存在不规范的IP地址段', '时间：2020年4月4日\n问题描述：进行WAF架构调整发布，由边界调整到DMZ内部，以便检测解密后的流量。发布操作完成后，各应用负责人进行了验证，并反馈正常。但在4月5日中转库出厂物流打印功能异常、4月6日经销商无法收到公司发送的邮件及4月7日河西基地部分用户无法访问拉动系统（详见附件报告）。', '1. 针对网络/安全设备的版本升级，需考虑新旧版本策略经转化后对应用的影响，做好新旧版本组、对象和策略等的比对检查\n2. 当应用互联网出口线路中断恢复或设备切换后，如果应用存在异常，可以通过清除F5缓存方式恢复正常\n3. 进行业务验证时，需要对应用的关键业务功能模块进行验证。特别是针对HTTPS的应用变更发布，如果经过WAF并且流量已经解密的系统，都必须进行关键业务的功能的验证，以免被WAF安全策略拦截\n4. 针对WAF/防火墙架构调整时，要进行策略进行回顾，识别架构调整后对内外网的影响，并进行验证', '架构管理,变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (45, NULL, 0, NULL, '出厂物流系统', '出厂物流归档发布', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '027-20200117-414', '028-20200325-631', NULL, '营销服务科', '问题1:归档操作的数据库语句原理是导出不清理的数据到文本、原表重命名、新建表、从之前创建的文本导入数据到新表中，再删除旧表的方式对数据进行归档及清除，在执行item_key表的过程中，最后一部旧表虽已重命名，但是未执行删除（删除失败，执行语句需一行行执行），旧表中的约束键导致入库操作冲突\n2、归档操作的数据库语句原理是导出不清理的数据到文本、原表重命名、新建表、从之前创建的文本导入数据到新表中，再删除旧表的方式对数据进行归档及清除，该操作过程遗漏索引重新创建操作', '1、出厂物流数据库归档后无法入库问题\n2、出厂物流数据库归档后生产业务操作经常失败或无响应', '1、出厂物流入库操作的测试验证常因需要实车无法满足而忽略，需设计该场景的模拟验证方式\n2、索引缺失问题在测试环境中测试不出来问题，到生产环境就会出现，原因是业务量问题，索引主要影响的是数据库的执行效率问题，日常变更发布并不会做压力测试验证，日后对数据库级别的发布操作及日常维护需关注好索引', '后台,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (46, NULL, 0, NULL, '营销节点', '华为公有云服务失效', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '0', '0', '0', '0', '营销服务科', '2020年4月10日，华为对华北-北京四区域硬件服务器进行维护操作时，因操作不当导致部分服务器重启，其中涉及计算、存储、数据库等服务。', '时间： 2020年4月10日  09:20 SGMW业务部门反馈业务异常，宝骏APP无法使用。\n            尝试登陆华为云控制台进行检查发现无法登陆\n           13：30 宝骏APP生产及测试环境应用恢复，数据无丢失', '1、公有云资源分布虽然越集中成本越节省，但是也不能把鸡蛋全部放在一个篮子里，云服务仍有可能出现大面积问题，而且出现时可能束手无策，所以云上也需要做备份及对应的DR方案', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (47, NULL, 0, NULL, '总部共享文件服务', '2020-03-30 共享文件夹访问慢系列事件', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '企业办公服务科', '直接原因：文件服务器SMB服务失效。\n根本原因：尚不明确，需要更多信息才能确定。\n\n5.1日，服务器器出发蓝屏抓包分析，发现是VMWare的一个无地阿里杀毒驱动造成文件服务异常。彻底卸载后，故障不再复现。', '2020.3.30 （周一）\n10:30左右，郑鈜、袁巧利，在验证研发新建的科室文件夹访问时，发现\\\\sgmw\\dep（文件多数存放在服务器HQFS01的D盘）访问很慢，但终端没有提示报错。登录服务器检查，CPU、内存、网络均正常。\n10:50左右，重启服务器之后，文件服务恢复正常。\n根据以往经验判断，可能与3.20切换杀毒模式有关，11:30左右将服务器杀毒从无代理切换回有代理运行。\n13:00左右，研发反馈在上午10:00左右少数用户登录tcae异常，下午仍旧有部分用户登录异常，多次尝试登录后恢复。此时文件访问正常。\n\n2020.4.1 （周三）\n12:40左右，朱炬明、黄菁反馈\\\\sgmw\\dep访问很慢。登录服务器检查，CPU、内存、网络均正常，未能发现异常。\n在客户端访问\\\\sgmw\\dep很慢的时候，研发TCAE登录（需要访问路径\\\\sgmw\\tcae）也出现异常，无法获取配置文件。直接从TCAE存储拷贝文件，偶尔而出现拷贝出错的现象，但重复操作，发现问题可以解决。\n12:50左右，重启服务器，文件访问恢复正常。\n2020.4.3 （周五）\n12:00左右，郑勇、韦翠翠、郭水萍反馈\\\\sgmw\\dep访问很慢。登录服务器检查，CPU、内存，网络正常。\n在客户端访问\\\\sgmw\\dep很慢，从服务器自身访问也出现卡顿。同时，研发TCAE登录也出现异常。\n逯晓明打开资源监视器，发现有NBU备份程序在运行，关闭NBU备份后，网络流量、磁盘I/O读写有所率下降，但访问依旧卡顿。同时发现，从上周末开始，HQFS01的备份策略，有4条加速备份策略失效，原因待查。\n12:10左右，重启服务器，文件访问恢复正常。\n\n2020.4.7 （周二）INSERT INTO `knlge_lesson_learn` VALUES (48, NULL, 0, NULL, '总部应用负载均衡', 'F5 DNS解析', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', '公司电信的互联网IP地址有两段：202.103.207.0/27和22.217.19.128/27，但在F5的DNS中没有配置202.103.207.0/27这个网段。', 'oa.sgmw.com.cn在F5上发布DNS，解析电信（222.217.19.131）和联通（221.7.137.110）两个IP地址，但用户从电信、联通、移动等不同的运营商均只能解析联通的IP地址（221.7.137.110）', '在公司新增互联网网段的时候，需要全面识别关联配置', NULL);
INSERT INTO `knlge_lesson_learn` VALUES (49, NULL, 0, NULL, '总部EAI', '', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2020051179', NULL, NULL, '028-20200514-754', NULL, '数据服务科', '1、2017年总部EAI执行COC模板变更，接口配置错误——根本原因；\n2、COC数据上传服务及国家端无有效校验和用户验证方式，未能发现上传数据缺漏。', '总部EAI升级项目，生产节点测试过程中发现现有平台COC数据上传接口存在问题：总部EAI在接收HXMIS和QDMIS传输的COC数据时，“环保公开编号”字段映射错误（空字段），导致HXMIS和QDMIS 实际上传国家数据中该字段为空。', '1、建立总部EAI变更发布后checklist\n2、对于国家无测试环境的接口，变更发布后需详细核对发送报文是否一致。', '变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (50, NULL, 0, NULL, '超融合平台', '超融合平台升级', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', '超融合平台主机存在内存硬件故障，但升级前未能识别出节点存在硬件故障', '超融合平台进行升级时，另一节点主机发生硬件故障，导致集群出问题，从而影响集群上面的虚拟机部分失效', '在进行平台升级时，需对集群内的主机运行状态以及底层的硬件状态进行检查，状态正常再进行升级', '运维管理,变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (51, NULL, 0, NULL, '宝骏ISE', '宝骏基地一期办公网络接入认证失效事件报告', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '宝骏基地服务科', '原因为ISE版本和2016 版的AD不兼容导致', 'ISE认证失效事件影响范围：主要影响到一期办公电脑有线网络接入（冲压、车身、涂装、总装一期、LOC、发动机工厂等），对于IP电话、办公无线网络、生产和控制网络不影响；\n此范围内的办公电脑的有线网络无法使用，WIFI正常', '1、宝骏办公域服务器OS升级，关联服务识别不充分，ISE无测试环境，只能在生产环境中验证；\n2、考虑到宝骏ISE系统陈旧，无相关运维服务，决定下架ISE服务，同时将接入认证服务前移到总部接入认证平台；', '工厂,后台,变更管理');
INSERT INTO `knlge_lesson_learn` VALUES (52, NULL, 0, NULL, '河西生产网络&amp;办公网络', '河西基地西部OA汇聚交换机失效', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '河西基地服务科', '交换机存储文件损坏，导致交换机不断重启，判断根本原因为交换机老化损坏。', '0:27 河西服务台接到4起用户（冲压办公室、西车物流、西总物流）报告故障，电脑连接不上网络，提示感叹号。IT值班人员彭桂中检查用户电脑连接时断时续。\n0:35  彭桂中联系莫仲飞检查上级交换机情况，莫仲飞初步判断为批量故障，让彭桂中联系上级经理李今。李今、莫仲飞、彭桂中组建故障处理小组。\n0:51 莫仲飞检查确认为西部OA汇聚交换机存在问题，并通知彭桂中去西涂IC间检查现场硬件设备。\n1:13 彭桂中现场检查发现交换机不断重启，估计硬件损坏，莫仲飞进场准备备用设备更换。\n1:17 李今联系黄总上升重大事件。\n1:46 莫仲飞达到公司在发动机机房拿到备机准备进行更换。\n4:33 莫仲飞完成交换机更换和重新配置。\n4:38 彭桂中联系用户确认故障点位网络恢复正常。', '1、交换机失效事件影响范围：主要影响到西部所有车间办公室、西车物流、西总物流现场办公电脑有线网络接入，对于IP电话、办公无线网络、生产和控制网络不影响；\n2、部分现场物流生产点位（用于打印排序单）接入办公网络，导致无法打印排序单。业务安排使用其他区域电脑查看排序单，无停线；后续需要整理现有现场点位情况，对使用生产办公网络混用情况进行排查整改\n3、河西基地网络设备部分使用年限已经超过10年，硬件设备容易损坏；后续需要排查河西基地现有网络设备，对于超期设备进行风险评估，风险较大的进行更换；\n4、河西基地无汇聚层交换机备机，此次使用发动机网络改造设备替用。需要与网络及云服务器考虑备件共享方案', '工厂,现场');
INSERT INTO `knlge_lesson_learn` VALUES (53, NULL, 0, NULL, '互联网域名解析', '应用发布电信互联网线路故障重大事件总结', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', '电信侧网络设备模块无响应，重新拔插后网络恢复正常', '9月11日\n9:20 监控发现应用发布电信互联网线路中断，联通线路正常\n9:25 在值班群通报线路中断故障，同时让各区域确认对外发布服务是否受影响\n9:43 完成将Portal认证系统在联通线路上进行发布\n9:45 监控显示电信线路已恢复正常\n9:57 各区域反馈对外发布服务恢复正常', '1、问题：电信联通同时发布的系统，因操作系统以及浏览器存有电信DNS缓存，当电信线路中断时，部分用户访问失效\n      经验：清除电脑及IE浏览器DNS缓存，以便用户快速访问系统\n2、问题：部分系统只在电信做发布，未在联通线路上进行发布，当电信线路故障时造成服务失效\n     总结：目前电信可用公网IP为7个（共64个），联通可用公网IP为2个（共32个），申请对电信和联通IP地址扩容，并对对外发布的系统均配置电信和联通双IP发布', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (54, NULL, 0, NULL, '总部应用负载均衡', '2020-09-14 邮件系统的服务失效事件报告', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '网络及云服务科', '在9月7日，WAF进行了一次特征库的更新，将内网邮件服务器与DMZ区邮件服务器的正常通信误判为威胁，拦截威胁导致DMZ区服务器上承载的用户收信延迟。', '2020-09-10发现有个别用户邮件收件较慢\n17:00  确认大部分故障是邮件无法实时到达DMZ区服务器CNWULHQMP02上。\n9月10日-14日期间对邮件系统进行问题排除\n14日\n23:05    发现网络设备WAF出现大量拦截信息，并把邮件服务器加入WAF白名单。\n23:10    邮件系统恢复正常', '与厂家协查，发现将邮件的1352端口误判为web服务，同时邮件自身加密机制，导致waf判定为web缓冲区溢出。\n厂家需完善waf识别机制并进行补丁升级', '运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (55, NULL, 0, NULL, '总部邮件系统', '邮件证书失效', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '企业办公服务科', '直接原因： \n在10月18日，邮件系统所使用的的证书已过期，导致使用证书的服务（手机邮箱）无法提供服务。\n根本原因：\n系统日常检查未检查域名证书有效期检查', '无法使用手机邮件', '根治措施\n邮件系统之后应使用公司统一购买的证书，统一进行证书管理，避免因单独购买证书导致没有统筹管理而出现证书过期未更换的情况。\n将域名证书检查纳入系统日常检查项。', '后台,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (56, NULL, 0, NULL, '宝骏物流系统', '宝骏MPS车辆移动信息订阅接口返回状态优化', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'CASE2020100807', '027-20201022-776', '028-20201022-1065', NULL, '宝骏基地服务科', '1.PTS/MES车辆移动信息发布接口偶发出现EAI写库超过120s（正常2-3秒写完并返回），上游PTS/MES系统接口超时时间为120s，因EAI返回超时，导致PTS/MES车辆移动数据未更新时间戳，重发导致MPS接收到车辆数据重复。\n2.MPS订阅车辆移动信息接口在上游发重复数据时返回aborted状态，该接口有失败重发机制，导致一直重发该车辆数据数据引起堵塞，后续正常车辆上线数据无法接收（当前只有一个状态“aborted”（超时和数据重复），EAI接收到这个状态就解析为“E”, 执行数据重发）。', '2020年10月14日18:05分左右，接口异常告警报错，EAI重复发送车辆数据，MPS无法正常接收到车辆上线队列', '1.系统间数据传输需要进一步完善机制，返回状态要进行全面验证，不同状态返回的数据处理机制要明确并符合现场实际运行需求\n2.项目或运维，要加强系统接口机制逻辑梳理及关联场景验证', '工厂,现场,IT缺陷,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (57, NULL, 0, NULL, '制造质量集成管理系统', '生产制造公用系统运维职责', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '生产服务科', 'VMQIS、Portal、出厂物流系统服务器设置在总部、各基地有客户端使用。', 'VMQIS、Portal、出厂物流系统是服务器设置在总部、各基地集成使用的公共系统，对这些系统的运维职责进行了定义，明确了各站点及总部生产服务科/营销系统科负责人相应的职责。', '对系统运维职责进行明确的定义，确保系统的正常运行及问题响应。', '工厂,后台,前台,运维管理');
INSERT INTO `knlge_lesson_learn` VALUES (58, NULL, 0, NULL, '总部邮件系统', '手机邮件证书过期', 999, b'1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '企业办公服务科', '手机邮件服务器上证书过期没有进行及时更换', '手机邮箱无法使用登录', '将证书检查加入至日常系统检查内，然后使用公司统一证书，方便统一管理', '后台,运维管理');
